import React from 'react';
import ReactDOM from 'react-dom/client';
import Rectangle from './Rect.js';
import './App.css';

function App() {
  return (
    <div>
      <div >
          <Rectangle className="left"/>
      </div>
      <div className="right" >
          <Rectangle className="right"/>
      </div>
    </div>
);
}

export default App;
